(1, 'CD19-1', 'User', 'covid19', '8526737834', 'வேதாரண்யம் நகராட்சி தானியங்கி சேவை மையம் அன்புடன் வரவேற்கிறது. உங்கள் தேவை அறிய நகராட்சி ஊழியர் 290452 என்ற எண்ணிலிருந்து விரைவில் தொடர்பு கொள்வார்.', '2020-04-10 17:35:12', NULL),
