(55, 'CD19-19', 'User', 'covid19', '7397396229', 'தங்கள் கோரிக்கை/புகார்  எண் CD19-19 பூர்த்தி செய்யப்பட்டுவிட்டது. ஏதேனும் குறைகள் இருந்தால் VMC டைப் செய்து ஒரு space விட்டு உங்கள் கோரிக்கை/புகார் எண்ணையும் டைப் செய்து 56161 என்ற எண்ணிற்கு குறுந்செய்தி (SMS) அனுப்பினால் உங்கள் கோரிக்கை /புகார் மறுபரிசீலனை செய்யப்படும்.', '2020-04-11 19:13:31', NULL),
(56, 'CD19-20', 'User', 'covid19', '8526737834', 'வேதாரண்யம் நகராட்சி தானியங்கி சேவை மையம் அன்புடன் வரவேற்கிறது. உங்கள் தேவை அறிய நகராட்சி ஊழியர் 290452 என்ற எண்ணிலிருந்து விரைவில் தொடர்பு கொள்வார்.', '2020-04-11 19:51:03', NULL),
(57, '1', 'User', 'covid19', '8526737834', 'வேதாரண்யம் நகராட்சி தானியங்கி சேவை மையம் அன்புடன் வரவேற்கிறது. உங்கள் தேவை அறிய நகராட்சி ஊழியர் 290452 என்ற எண்ணிலிருந்து விரைவில் தொடர்பு கொள்வார்.', '2020-04-11 19:54:50', NULL),
