(60, 'CD19-19', 'User', 'covid19', '7397396229', 'நகரட்சியை மீண்டும் தொடர்பு கொண்டமைக்கு நன்றி.உங்கள் புகார்/கோரிக்கை எண்:  CD19-19 சரிவர பூர்த்திசெய்யத்தமைக்கு வருந்துகிறோம். மேலும் நகராட்சி ஆணையரின் நேரடி பார்வையில் தங்கள் புகார்/கோரிக்கை பூர்த்திசெய்யப்படும்.', '2020-04-11 20:53:09', NULL),
