(156, '41', 'User', 'covid19', '9442150139', 'வேதாரண்யம் நகராட்சி தானியங்கி சேவை மையம் அன்புடன் வரவேற்கிறது. உங்கள் தேவை அறிய நகராட்சி ஊழியர் 290452 என்ற எண்ணிலிருந்து விரைவில் தொடர்பு கொள்வார்.', '2020-04-15 00:54:25', NULL),
